    constructor(props){
        super(props)
        this.state={

        }
    }

    render(){
        return(
            <div className='topbar'>

                {/* My name and wisconsin Image */}
                <Card clickable={false} height='100%' width='40vw' style={{flex: 1}}>
                <img src={uwLogo} style={{ height: 40, width: 40, flex: 1 }}></img>
                    <text style={{ fontFamily: 'Helvetica', fontSize: 50, paddingLeft: 20, flex: 1 }}>
                        Max Johnson
                </text>
                </Card>

                {/* Home Button */}
                <Card clickable={true} height='100%' width= '15vw'>
                    <text style={{fontSize: 50}}>
                        Home
                    </text>
                </Card>

                {/* Projects Button */}
                <Card clickable={true} height='100%' width= '15vw'>
                    <text style={{fontSize: 50}}>
                        Projects
                    </text>
                </Card>

                {/* Gallery Button */}
                <Card clickable={true} height='100%' width= '15vw'>
                    <text style={{fontSize: 50}}>
                        Gallery
                    </text>
                </Card>

                {/** Contact Button */}
                <Card clickable={true} height='100%' width= '15vw'>
                    <text style={{fontSize: 50}}>
                        Contact
                    </text>
                </Card>
                
            </div>
        )
    }
}
